import React, { Component } from 'react';
// import axios from 'axios';



export default class cropCreate extends Component {


    constructor() {
        super();
        this.onChangeItemId = this.onChangeItemId.bind(this);
        this.onChangeFid = this.onChangeFid.bind(this);
        this.onChangeName = this.onChangeName.bind(this);
        this.onChangePrice = this.onChangePrice.bind(this);
        this.onChangeDescription = this.onChangeDescription.bind(this);
        this.onChangePicture = this.onChangePicture.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);

        this.state = {
            item_id: '',
            fid: '',
            item_name: '',
            item_price: '',
            item_description: '',
            item_picture: ''
        }
    }

    onChangeItemId(e) {
        this.setState({
            item_id: e.target.value
        });
    }
    onChangeFid(e) {
        this.setState({
            fid: e.target.value
        });
    }
    onChangeName(e) {
        this.setState({
            item_name: e.target.value
        });
    }
    onChangePrice(e) {
        this.setState({
            item_price: e.target.value
        });
    }
    onChangeDescription(e) {
        this.setState({
            item_description: e.target.value
        });
    }
    onChangePicture(e) {
        this.setState({
            item_picture: e.target.value
        });
    }


    handleSubmit(event) {
        event.preventDefault();
    }


    render() {
        return (
            <div>
                <form onSubmit={this.handleSubmit}>
                    <div>
                        <label>
                            Item Name:
                            <input type="text" value={this.state.item_name} onChange={this.onChangeName} />
                        </label>
                    </div>
                    <div>
                        <label>
                            Item Price:
                            <input type="text" value={this.state.item_price} onChange={this.onChangePrice} />
                        </label>
                    </div>
                    <div>
                        <label>
                            Description:
                            <input type="text" value={this.state.item_description} onChange={this.onChangeDescription} />
                        </label>
                    </div>
                    <div>
                    <label>
                        item image:
                    <input type="file" value={this.state.item_price} onChange={this.onChangePicture} />
                    </label>
                    </div>
                    <input type="submit" value="Submit" />
                </form>
            </div>
        )
    }
}
